function main()

	if not isSampLoaded() or not isSampfuncsLoaded() then return end
	while not isSampAvailable() do wait(100) end

	checklibs()

	checkupdate()

	imgui_style()

	lua_thread.create(function () -- очередь запросов
		while true do
			wait(0)
			if not http_request_active and #http_turn >= 1 then
				wait(150)
				value = http_turn[#http_turn]
				http_request_active = true
				http_turn[#http_turn] = nil
				asyncHttpRequest(value.method, value.url, value.args, function(response)
					value.resolve(response)
					http_request_active = false
				end, function (err)
					value.reject(err)
					http_request_active = false
				end)
			end
		end
	end)

	serial = getHarddiskSerial()

	tablet_image = imgui.CreateTextureFromMemory(memory.strptr(tablet_image_data), #tablet_image_data)
	pin_image = imgui.CreateTextureFromMemory(memory.strptr(pin_image_data), #pin_image_data)

	glyph_ranges_cyrillic = imgui.GetIO().Fonts:GetGlyphRangesCyrillic()
	arial_20 = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. '\\arial.ttf', 20.0, nil, glyph_ranges_cyrillic)
	arial_16 = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. '\\arial.ttf', 16.0, nil, glyph_ranges_cyrillic)
	arial_13 = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. '\\arial.ttf', 13.0, nil, glyph_ranges_cyrillic)
	impact_20 = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. '\\impact.ttf', 20.0, nil, glyph_ranges_cyrillic)
	impact_25 = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. '\\impact.ttf', 25.0, nil, glyph_ranges_cyrillic)
	impact_35 = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. '\\impact.ttf', 35.0, nil, glyph_ranges_cyrillic)

	sampRegisterChatCommand("ccp", function ()
		if sampGetCurrentServerName():find("Evolve") and sampGetCurrentServerName():find(SERVER_NUMBER) then 
			if not sampIsDialogActive() then
				tablet_window_status.v = not tablet_window_status.v
				if tablet_window_status.v then
					tablet_loading = {
						status = "login",
						error="",
						login=imgui.ImBuffer("", 126),
						password=imgui.ImBuffer("", 126),
						check_work="checking"
					}
					lua_thread.create(function (...)
						sampSendChat("/stats")
						wait(1000)
						sampSendChat("/me достал планшет.")
					end)
					info_player.nickname = GetNickName():gsub("_", " ")

					lua_thread.create(function ()
						local nickname = GetNickName():gsub("_", " ")
						local password = "randomsymbols"
						local index = {login=1, password=1}
						local time_start = os.time()
						while tablet_window_status.v do
							wait(0)

							if tablet_loading.status == "login" then
								if nickname ~= tablet_loading.login.v then
									tablet_loading.login.v = tablet_loading.login.v..nickname:sub(index.login, index.login)
									index.login = index.login + 1
								elseif password ~= tablet_loading.password.v then
									tablet_loading.password.v = tablet_loading.password.v..password:sub(index.password, index.password)
									index.password = index.password + 1
								else
									if tablet_loading.check_work == "checked" then

										if info_player.isWorkPD then
											if token ~= nil then
												calls_list = nil
												calls_list_time = 0

												if patrol.status then -- Если есть активный патруль, сразу переходим на эту вкладку
													selected = 4
												else
													selected = 0
												end
												tablet_loading.status = "menu"
											end
										else
											errorMessage("Ваша учетная запись не была найдена\nв базе данных San Andreas Police Department.")
										end
									end
								end
							else
								break
							end
						end
					end)
				else
					sampSendChat("/me убрал планшет.")
				end
			else
				message("Ошибка: Все диалоговые окна должны закрыты!")
			end
		else
			message("Ошибка: КПК достпен только на сервере Evolve Role Play 03!")
		end
	end)

	message("Полицейский планшет | Cooper Company | /ccp")

	while true do
		wait(0)

		

		if tablet_window_status.v or info_cords_broadcast.v or os.time() - notification.time < 5 or patrol.status then
			imgui.Process = true
	        imgui.ShowCursor = tablet_window_status.v
	        if tablet_window_status.v and isKeyDown(VK_E) and not sampIsChatInputActive() then
	        	sampSendChat("/me убрал планшет.")
	        	tablet_window_status.v = false
	        end
		else
			imgui.Process = false
	        imgui.ShowCursor = false
		end


		if tablet_window_status.v and last_call.id ~= -1 and GetNickName(last_call.id) ~= last_call.nickname then last_call.id = -1 end

		if type(calls_list) == "table" and tablet_window_status.v then
			for key, value in pairs(calls_list.calls) do
				if GetNickName(value.id_cop) == value.nickname then

					for k, v in pairs(calls_list.received_calls) do
						if v.id_call == value.id then
							if GetNickName(v.id_cop) ~= v.nickname then
								calls_list.received_calls[k] = nil
							end
						end
					end
				else
					calls_list.calls[key]=nil
				end
			end
		end

		if patrol.status then
			local result, handle_car = sampGetCarHandleBySampVehicleId(patrol.id_car)
			if result and isCharInCar(PLAYER_PED, handle_car) then
				patrol.last_lost = os.time()
			end
			if os.time() - patrol.last_lost >= 600 then
				deletePatrol()
				message("Вы не вернулись в патрульное авто в течение 10 минут, патруль завершен.")
				patrol.last_lost = os.time()
			end
		end

		if db_fine.search_status then
			if db_fine.search.v == "" then
				db_fine.list = nil
				local post = {}
				post.data = "session_key="..token
				post.headers = {
					['content-type']='application/x-www-form-urlencoded'
				}
				http_request("POST", "http://"..domain.."/api.php?get_db_fine", post,
					function(response)
						local server_info = decodeJson(response.text)
						if server_info ~= nil then
							if server_info.response ~= nil then
								db_fine.list = server_info.response
							elseif server_info.error ~= nil then
								errorMessage(server_info.error.message, false)
								if server_info.error.message:find("invalid_token") then token = nil end
							else
								print("Сервер прислал неверный ответ: "..response.text)
								errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
							end
						else
							print("Сервер прислал неверный ответ: "..response.text)
							errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
						end
					end,
					function(err)
						print("Ошибка во время соеденения: "..err)
						errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
					end)
				db_fine.search_status = false
			end
		end

		if db_criminals.search_status then
			if db_criminals.search.v == "" then
				db_criminals.list = nil
				local post = {}
				post.data = "session_key="..token
				post.headers = {
					['content-type']='application/x-www-form-urlencoded'
				}
				http_request("POST", "http://"..domain.."/api.php?get_db_criminal", post,
					function(response)
						local server_info = decodeJson(response.text)
						if server_info ~= nil then
							if server_info.response ~= nil then
								db_criminals.list = server_info.response
							elseif server_info.error ~= nil then
								errorMessage(server_info.error.message, false)
								if server_info.error.message:find("invalid_token") then token = nil end
							else
								print("Сервер прислал неверный ответ: "..response.text)
								errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
							end
						else
							print("Сервер прислал неверный ответ: "..response.text)
							errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
						end
					end,
					function(err)
						print("Ошибка во время соеденения: "..err)
						errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
					end)
				db_criminals.search_status = false
			end
		end

		if calls_list == nil and token ~= nil and tablet_window_status.v then
			calls_list = "check"
			local post = {}
			post.data = "session_key="..token
			post.headers = {
				['content-type']='application/x-www-form-urlencoded'
			}
			http_request("POST", "http://"..domain.."/api.php?get_calls", post,
				function(response)
					local server_info = decodeJson(response.text)
					if server_info ~= nil then
						if server_info.response ~= nil then
							for key, value in pairs(server_info.response.calls) do
								if GetNickName(value.id_cop) == value.nickname then

									for k, v in pairs(server_info.response.received_calls) do
										if v.id_call == value.id then
											if GetNickName(v.id_cop) ~= v.nickname then
												server_info.response.received_calls[k] = nil
											end
										end
									end
								else
									server_info.response.calls[key]=nil
								end
							end
							calls_list = server_info.response
						elseif server_info.error ~= nil then
							errorMessage(server_info.error.message, false)
							if server_info.error.message:find("invalid_token") then token = nil end
						else
							print("Сервер прислал неверный ответ: "..response.text)
							errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
						end
					else
						print("Сервер прислал неверный ответ: "..response.text)
						errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
					end
				end,
				function(err)
					print("Ошибка во время соеденения: "..err)
					errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
				end)
		end

		if received_call_info.status and received_call_info.id_received_calld ~= -1 then
			if os.time() - received_call_info.time >= 1 then
				for key, value in pairs(http_turn) do
					if value.url == "http://"..domain.."/api.php?get_calls_cords" then
						http_turn[key]=nil
					end
				end
				local post = {}
				post.data = "session_key="..token.."&id_received_call="..received_call_info.id_received_call
				post.headers = {
					['content-type']='application/x-www-form-urlencoded'
				}
				http_request("POST", "http://"..domain.."/api.php?get_calls_cords", post,
					function(response)
						if received_call_info.status then
							local server_info = decodeJson(response.text)
							if server_info ~= nil then
								if server_info.response ~= nil then
									if server_info.response ~= "not_found" and GetNickName(received_call_info.id_cop) == received_call_info.nickname then
										if received_call_info.blip == nil then
											received_call_info.blip = addSpriteBlipForCoord(server_info.response.x, server_info.response.y, server_info.response.z, 61)
										else
											setBlipCoordinates(received_call_info.blip, server_info.response.x, server_info.response.y, server_info.response.z)
										end
									else
										if type(calls_list) == "table" then
											for key, value in pairs(calls_list.calls) do
												if value.id == received_call_info.id_call then
													calls_list.calls[key] = nil
												end
											end
										end
										if received_call_info.blip ~= nil then removeBlip(received_call_info.blip); received_call_info.blip = nil end
										received_call_info = {id_received_call=-1, id_call=-1, status=false, time=0, blip=nil, id_cop=0, nickname=""}
										message("Сотрудник перестал раздавать свое местоположение.")
									end
								elseif server_info.error ~= nil then
									errorMessage(server_info.error.message, false)
									if received_call_info.blip ~= nil then removeBlip(received_call_info.blip); received_call_info.blip = nil end
									received_call_info = {id_received_call=-1, id_call=-1, status=false, time=0, blip=nil, id_cop=0, nickname=""}
									if server_info.error.message:find("invalid_token") then token = nil end
								else
									print("Сервер прислал неверный ответ: "..response.text)
									if received_call_info.blip ~= nil then removeBlip(received_call_info.blip); received_call_info.blip = nil end
										received_call_info = {id_received_call=-1, id_call=-1, status=false, time=0, blip=nil, id_cop=0, nickname=""}
									errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
								end
							else
								print("Сервер прислал неверный ответ: "..response.text)
								if received_call_info.blip ~= nil then removeBlip(received_call_info.blip); received_call_info.blip = nil end
								received_call_info = {id_received_call=-1, id_call=-1, status=false, time=0, blip=nil, id_cop=0, nickname=""}
								errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
							end
						end
					end,
					function(err)
						print("Ошибка во время соеденения: "..err)
						if received_call_info.blip ~= nil then removeBlip(received_call_info.blip); received_call_info.blip = nil end
						received_call_info = {id_received_call=-1, id_call=-1, status=false, time=0, blip=nil, id_cop=0, nickname=""}
						errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
					end)
			end

			received_call_info.time = os.time()
		else
			if received_call_info.blip ~= nil then removeBlip(received_call_info.blip); received_call_info.blip = nil end
		end

		if call_info.status and call_info.id_call ~= -1 then
			info_cords_broadcast.v = true

			if os.time() - call_info.time >= 1 then
				local x, y, z = getCharCoordinates(PLAYER_PED)
				local post = {}
				post.data = "session_key="..token.."&id_call="..call_info.id_call.."&x="..x.."&y="..y.."&z="..z
				post.headers = {
					['content-type']='application/x-www-form-urlencoded'
				}
				http_request("POST", "http://"..domain.."/api.php?broad_cords_call", post,
					function(response)
						local server_info = decodeJson(response.text)
						if server_info ~= nil then
							if server_info.response ~= nil then
								-- OK
							elseif server_info.error ~= nil then
								errorMessage(server_info.error.message, false)
								call_info = {code=-1, id_call=-1, status=false, time=0}
								if server_info.error.message:find("invalid_token") then token = nil end
							else
								print("Сервер прислал неверный ответ: "..response.text)
								call_info = {code=-1, id_call=-1, status=false, time=0}
								errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
							end
						else
							print("Сервер прислал неверный ответ: "..response.text)
							call_info = {code=-1, id_call=-1, status=false, time=0}
							errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
						end
					end,
					function(err)
						print("Ошибка во время соеденения: "..err)
						call_info = {code=-1, id_call=-1, status=false, time=0}
						errorMessage("Произошла ошибка во время подключения к серверу\nПопробуйте позже..")
					end)

				call_info.time = os.time()
			end
		else
			info_cords_broadcast.v = false
		end

		if token ~= nil and session_server_id ~= GetID() then token = nil end

	end
end

function imgui.OnDrawFrame()

	if patrol.status and not tablet_window_status.v then
		local result, handle_car = sampGetCarHandleBySampVehicleId(patrol.id_car)
		if result then
			local x, y, z = getCarCoordinates(handle_car)
			if isCarOnScreen(handle_car) then
				x, y = convert3DCoordsToScreen(x, y, z)

				imgui.PushStyleColor(imgui.Col.WindowBg, imgui.ImVec4(0.06, 0.05, 0.07, 0.00))

				imgui.SetNextWindowPos(imgui.ImVec2(x, y), imgui.Cond.Always, imgui.ImVec2(0.5, 0.5))
				imgui.SetNextWindowSize(imgui.ImVec2(350, 100), imgui.Cond.FirstUseEver)

				imgui.Begin("info_about_car_patrol", nil, imgui.WindowFlags.NoResize + imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoScrollbar + imgui.WindowFlags.NoScrollWithMouse)
					imgui.PushFont(fa_font_big)
					local icon;
					if tonumber(patrol.type_veh) == 0 then
						icon = fa.ICON_FA_CAR
					elseif tonumber(patrol.type_veh) == 1 then
						icon = fa.ICON_FA_MOTORCYCLE
					end
					local text_width = imgui.CalcTextSize(icon)
				    imgui.SetCursorPosX(50)
				    imgui.SetCursorPosY( imgui.GetWindowHeight() / 2 - text_width.y / 2 )
					imgui.Text(icon)
					imgui.PopFont()
					imgui.SameLine()
					imgui.SetCursorPosY(30)
					imgui.Text(patrol.mark..u8" патрульное т/с")
					imgui.SetCursorPosX(110)
					if isCharInCar(PLAYER_PED, handle_car) then
						imgui.Text(u8"В патруле"); imgui.SameLine(); imgui.TextColored(imgui.ImVec4(0, 0.61, 1, 1), tostring(math.ceil((os.time() - patrol.start_time) / 60))); imgui.SameLine(); imgui.Text(u8"минут");
					else
