			local strings_dialog = split(text, "\n")
			for k, v in pairs(strings_dialog) do
				local rang, rang_name = v:match("Должность\t\t\t\t\t\t\t(%d+) %((.+)%)")
				if rang and rang_name then
					info_player.rang = tonumber(rang)
					info_player.rang_name = trim(rang_name)
				end

				local organization = v:match("Организация\t\t\t\t\t\t(.+)")
				if organization then info_player.organization = trim(organization) end

				if info_player.rang and info_player.rang_name and info_player.organization then break end
			end

			if developeMode then
				info_player.organization = "LVPD"
				info_player.rang = 10
				info_player.rang_name = "Разработчик"
			end

			if info_player.organization == "LSPD" or info_player.organization == "SFPD" or info_player.organization == "LVPD" then info_player.isWorkPD = true else info_player.isWorkPD = false end

			if info_player.isWorkPD and token == nil then
				generateSession(info_player.organization)
			end
			tablet_loading.check_work = "checked"
			sampSendDialogResponse(dialogId, 0, 0, nil)
			return false
		end
	end
