function generateSession(city)
	local post = {}
	post.data = "serial="..serial.."&id="..GetID().."&nickname="..GetNickName().."&city="..city
	post.headers = {
		['content-type']='application/x-www-form-urlencoded'
	}
	http_request("POST", "http://"..domain.."/api.php?get_session", post,
		function(response)
			local server_info = decodeJson(response.text)
			if server_info ~= nil then
				if server_info.response ~= nil then
					session_server_id = GetID()
					token = server_info.response.session_key
