function table.reverse( tab )
    local size = #tab
    local newTable = {}
 
    for i,v in ipairs ( tab ) do
        newTable[size-i] = v
    end
 
    return newTable
end

function errorMessage(msg, encode)
	if encode == nil then encode = true end

	if encode then msg = u8(msg) end
	if tablet_window_status.v then
		tablet_loading.error = msg
		tablet_loading.status = "error"
	else
		message("Ошибка!")
		local error_strings = split(u8:decode(msg), "\n")

		for _, value in pairs(error_strings) do

			message(value)

		end
	end
end

